import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import React, {useState, useEffect} from "react";
import ReactDOM from 'react-dom';
import bugInfoApi from "../controllers/bugInfoApi.jsx";

function BugInfo(props) {

  const bugid = parseInt(props.bugid);
  let content = [];
  const [disableButton, setDisableButton] = useState(true);
  const [load, setLoad] = useState(false);

  const bugBar = [];
  const [bugInformation, setBugInformation] = useState([]);
  const preferences = [
    "Id",
    "Status",
    "Priority",
    "Severity",
    "Summary",
    "Last_change_time"
  ];

  async function callGetBugInfo(bugid) {
    let temp = await bugInfoApi(bugid);
    console.log("temp is:", temp);
    setBugInformation(temp);
    setLoad(true);
  }

  useEffect(() => {
    callGetBugInfo(bugid);
  }, []);

  { // const bugInformation = {
    //   "ID": 0,
    //   "CreatedAt": "2022-09-05T22:20:46.968199+05:30",
    //   "UpdatedAt": "2022-09-22T10:45:36.747303+05:30",
    //   "DeletedAt": null,
    //   "Id": 34620,
    //   "Comment_count": 151,
    //   "Type": "Sarthak",
    //   "Status": "VERIFIED",
    //   "Priority": "P3",
    //   "Summary": "address book nickname doesn't work doesn't workdoesn't workdoesn't workdoesn't workdoesn't workdoesn't work",
    //   "Severity": "normal",
    //   "Product": "MailNews Core",
    //   "Platform": "Other",
    //   "Resolution": "FIXED",
    //   "Target_milestone": "M16",
    //   "Classification": "Components",
    //   "Is_confirmed": true,
    //   "Is_open": false,
